import React from 'react';
import Resume from '../img/Resume.PNG';
import '../../styles/Contact.css';

export default function Contact() {
  return (
    <div id="Resume">
      <h1>Resume</h1>
      <div id="myResumeCard">
        <img id="myResume" src={Resume} />
      </div>
      <div>
        <a id="resumeDownload" href={Resume} download>Click to download</a>
      </div>
    </div>
  );
}
